import base45 from 'base45-js';
import pako from 'pako';
// import cose from 'cose-js';
import * as cbor from 'cbor';

// verifier-api.coronacheck.nl/v4/verifier/public_keys
const publicKey =
  '';

const claimMap: any = {
  '1': 'iss',
  '6': 'iat',
  '4': 'exp',
  '-260': 'hcert',
};

function fromMap(map: Map<any, any>): any {
  const obj: any = {};

  function processValue(k: any, v: any) {
    if (Array.isArray(v)) {
      processArray(k, v);
    } else if (v instanceof Map) {
      obj[k] = fromMap(v);
    } else {
      switch (k) {
        case claimMap['6']:
        case claimMap['4']:
          obj[k] = new Date(v * 1000);
          break;
        default:
          obj[k] = v;
      }
    }
  }

  function processArray(k: any, arr: any[]) {
    arr.forEach((v) => processValue(k, v));
  }

  const keys = Array.from(map.keys());

  keys.forEach((k) => {
    const v = map.get(k);
    const stringKey = `${k}`;
    const mappedKey: string = Object.keys(claimMap).includes(stringKey)
      ? claimMap[stringKey]
      : stringKey;
    processValue(mappedKey, v);
  });
  return obj;
}

export const decodeCovidCertificate = async (
  qrCodeContents: string,
): Promise<any> => {
  // extract the version with a regex
  const matches = qrCodeContents.match(/(\w+):(.+)/);
  if (!matches) {
    throw new Error(
      'Could not determine version. Must start with HC1:xxx, HC2:xxx',
    );
  }

  // parse the public key of the issuer and setup the COSE verifier
  // const key = Buffer.from(publicKey, 'base64');
  // const fingerprint = createHash().update(key).digest();
  // const keyID = fingerprint.slice(0, 8);
  // const keyX = Buffer.from(key.slice(1, 1 + 32));
  // const keyY = Buffer.from(key.slice(33, 33 + 32));
  // const verifier = { key: { x: keyX, y: keyY, kid: keyID } };

  // decode base45
  const compressed = base45.decode(matches[2]);
  const compressedData = new Uint8Array(compressed, 0, compressed.byteLength);

  // inflate if zipped, see https://github.com/ehn-dcc-development/ehn-sign-verify-javascript-trivial/blob/main/cose_verify.js#L44
  // Zlib magic headers:
  // 78 01 - No Compression/low
  // 78 9C - Default Compression
  // 78 DA - Best Compression
  const uncompressed =
    compressedData[0] === 0x78 ? pako.inflate(compressedData) : compressedData;

  // verify
  // const decoded = await cose.sign.verify(uncompressed, verifier);

  // decode CBOR
  const decoded = cbor.decodeFirstSync(uncompressed);

  // select the data part (ignore the signatures, etc) for now, and decode again
  // decoded.value.forEach((v: any) => console.log(v.toString()));
  const data = cbor.decodeFirstSync(decoded.value[2]);

  // munge maps into JS objects
  const obj = fromMap(data);

  // return as an object
  return obj;
};
